import React from 'react';
import girl from '../Assets/girl.jpg'; // Import the image file

import './Hero.css';

function Hero() {
  return (
    <div className='hero'>
      <div className='heroLeft'>
        <h2>NEW ARRIVAL ONLY</h2>
        <p>Be Style Be You</p>
      </div>

      <div className='heroRight'>
        <img src={girl} alt='' /> {/* Use the correct variable name */}
      </div>
    </div>
  );
}

export default Hero;
